import React from 'react';
import fetchCambio from '../fetch/fetchCambio';

class Login extends React.Component {
  constructor() {
    super();

    this.state = {
      cambio: [],
    };

    this.catchCambio = this.catchCambio.bind(this);
  }

  async componentDidMount() {
    await this.catchCambio();
  }

  async catchCambio() {
    const cambi = await fetchCambio();
    this.setState({
      cambio: cambi,
    });
  }

  render() {
    return (<div>login</div>);
  }
}
export default Login;
